from mhcgnomes import parse, Allele

def test_Aona_DQA1_27_01():
    result = parse('Aona-DQA1*27:01')
    assert result.__class__ is Allele, \
                    'Expected parse("Aona-DQA1*27:01") to be Allele but got %s' % (result,)
    assert result.num_allele_fields == 2, \
                                ('Expected parse("Aona-DQA1*27:01") to have 2 ' 
                                 'field(s) but got %d') % result.num_allele_fields

