    assert result.__class__ is Allele, \
                    'Expected parse("BoLA-2*060:02") to be Allele but got %s' % (result,)
    assert result.num_allele_fields == 2, \
                                ('Expected parse("BoLA-2*060:02") to have 2 ' 
                                 'field(s) but got %d') % result.num_allele_fields

